<h2 style="margin: 0">1</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Influence of major structural features of tocopherols and tocotrienols on their omega-oxidation by tocopherol-omega-hydroxylase . Human cytochrome P450 4F2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P78329
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) catalyzes the initial omega-hydroxylation reaction in the metabolism of tocopherols and tocotrienols to carboxychromanols and is , to date , the only enzyme shown to metabolize vitamin E . The objective of this study was to characterize this activity , particularly the influence of key features of tocochromanol substrate structure . The influence of the number and positions of methyl groups on the chromanol ring , and of stereochemistry and saturation of the side chain , were explored using HepG 2 cultures and microsomal reaction systems . Human liver microsomes and microsomes selectively expressing recombinant human 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P78329
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 exhibited substrate activity patterns similar to those of HepG 2 cells . Although activity was strongly associated with substrate accumulation by cells or microsomes , substantial differences in specific activities between substrates remained under conditions of similar microsomal membrane substrate concentration . Methylation at 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P01031
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 of the chromanol ring was associated with markedly low activity . Tocotrienols exhibited much higher Vmax values than their tocopherol counterparts . Side chain stereochemistry had no effect on omega-hydroxylation of DB00163 ( alpha-TOH ) by any system . Kinetic analysis of microsomal 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P78329
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 activity revealed Michaelis-Menten kinetics for alpha-TOH but allosteric cooperativity for other vitamers , especially tocotrienols . Additionally , alpha-TOH was a positive effector of omega-hydroxylation of other vitamers . These results indicate that 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P78329
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 - mediated tocopherol-omega-hydroxylation is a central feature underlying the different biological half-lives , and therefore biopotencies , of the tocopherols and tocotrienols .</div>

<h2 style="margin: 0">2</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35367
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 occupancy in human brains after single oral doses of histamine H1 antagonists measured by positron emission tomography . 1 . 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35367
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 occupancy in the human brain was measured in 20 healthy young men by positron emission tomography ( PET ) using [ 11C ] - doxepin . 2 . ( + ) - 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01114
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 , a selective and classical antihistamine , occupied 76.8 + / - 4.2 % of the averaged values of available histamine H1 receptors in the frontal cortex after its administration in a single oral dose of 2 mg . Intravenous administration of 5 mg ( + ) - chlorpheniramine almost completely abolished the binding of [ 11C ] - doxepin to H1 receptors ( H1 receptor occupancy : 98.2 + / - 1.2 % ) . 3 . Terfenadine , a nonsedative antihistamine , occupied 17.2 + / - 14.2 % of the available H1 receptors in the human frontal cortex after its administration in a single oral dose of 60 mg . 4 . There was no correlation between H1 receptor occupancy by terfenadine and the plasma concentration of the active acid metabolite of terfenadine in each subject . 5 . PET data on human brain were essentially compatible with those on H1 receptor occupancy in guinea-pig brain determined by in vivo binding techniques , although for the same H1 receptor occupancy the dose was less in human subjects than in guinea-pigs . 6 . The PET studies demonstrated the usefulness of measuring H1 receptor occupancy with classical and second-generation antihistamines in human brain to estimate their unwanted side effects such as sedation and drowsiness quantitatively .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">DB02546 and bortezomib synergistically cause ubiquitinated protein accumulation in prostate cancer cells . PURPOSE : Protein ubiquitination is a novel strategy used to treat malignancies . We investigated whether the histone deacetylase inhibitor vorinostat ( Cayman Chemical , Ann Arbor , Michigan ) and the proteasome inhibitor bortezomib ( LC Laboratories , Woburn , Massachusetts ) would synergistically cause the accumulation of ubiquitinated proteins in prostate cancer cells . MATERIALS AND METHODS : LNCaP , PC - 3 and DU 145 cells ( ATCC  ) were treated with vorinostat and / or bortezomib . Cell viability and induction of apoptosis were assessed . In vivo efficacy was evaluated in a murine subcutaneous tumor model using PC - 3 cells . The influence of androgen receptor expression on bortezomib efficacy was examined using RNA interference . Changes in the expression of ubiquitinated proteins , cell cycle associated proteins and acetylated histone were evaluated . RESULTS : 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P10275
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression seemed to decrease bortezomib activity . PC - 3 and DU 145 cells were more susceptible to bortezomib than LNCaP cells and the silencing of androgen receptor expression in LNCaP cells enhanced bortezomib activity . DB02546 and bortezomib synergistically induced apoptosis , inhibited prostate cancer cell growth and suppressed tumor growth in a murine xenograft model . The combination decreased cyclin D1 and cyclin-dependent kinase 4 expression , and increased 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P38936
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 expression . The combination synergistically caused the accumulation of ubiquitinated proteins and histone acetylation . This histone acetylation was a consequence of the accumulation of ubiquitinated proteins . CONCLUSIONS : DB02546 and bortezomib inhibit the growth of prostate cancer cells synergistically by causing ubiquitinated proteins to accumulate in cells . The current study provides a framework for testing the combination in patients with advanced prostate cancer .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Differential radiosensitisation by ZD1839 (

 ) is expressed in a wide variety of epithelial tumours including carcinoma of the bladder . Stimulation of the 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 pathway is blocked by ZD1839 ( 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) , a highly selective 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P00533

 tyrosine kinase inhibitor . Radical radiotherapy is an established organ sparing treatment option for muscle invasive bladder cancer and this study has explored the possibility for the use of ZD1839 as a radiosensitiser in this scenario . The effect of combination treatment with ZD1839 ( 0.01 microM ) and ionising radiation in the established bladder cancer cell lines MGH-U 1 and its radiosensitive mutant clone S40b was measured by clonogenic assays . A highly significant radiosensitising effect was seen in both cell lines ( P &lt; 0.001 for MGH-U 1 and S40b cell lines ) . This effect was independent of the concentration of the drug and the duration of exposure prior to treatment with ionising radiation . Cell cycle kinetics of both cell lines was not significantly altered with ZD1839 ( 0.01 microM ) as a single agent . A modest induction of apoptosis was observed with ZD1839 ( 0.01 microM ) as a single agent , but a marked induction was observed with the combination treatment of ZD1839 and ionising radiation . These results suggest a potentially important role for ZD1839 in combination with radiotherapy in the treatment of muscle invasive bladder cancer .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Epigenetic marks define the lineage and differentiation potential of two distinct neural crest-derived intermediate odontogenic progenitor populations . Epigenetic mechanisms , such as histone modifications , play an active role in the differentiation and lineage commitment of DB05914 . In the present study , epigenetic states and differentiation profiles of two odontogenic neural crest-derived intermediate progenitor populations were compared : dental pulp ( DP ) and dental follicle ( DF ) . ChIP on chip assays revealed substantial H3K27me3 - mediated repression of odontoblast lineage genes Q9NZW4 and dentin matrix protein 1 ( DMP 1 ) in DF cells , but not in DP cells . Mineralization inductive conditions caused steep increases of mineralization and patterning gene expression levels in DP cells when compared to DF cells . In contrast , mineralization induction resulted in a highly dynamic histone modification response in DF cells , while there was only a subdued effect in DP cells . Both DF and DP progenitors featured H3K4me3 - active marks on the promoters of early mineralization genes

<div class="entities" style="line-height: 2.5; direction: ltr">Therapeutic efficacy of anti-ErbB 2 immunoliposomes targeted by a phage antibody selected for cellular endocytosis . Many targeted cancer therapies require endocytosis of the targeting molecule and delivery of the therapeutic agent to the interior of the tumor cell . To generate single chain Fv ( scFv ) antibodies capable of triggering receptor-mediated endocytosis , we previously developed a method to directly select phage antibodies for internalization by recovering infectious phage from the cytoplasm of the target cell . Using this methodology , we reported the selection of a panel of scFv that were internalized into breast cancer cells from a nonimmune phage library . For this work , an immunotherapeutic was generated from one of these scFv ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) , which bound to ErbB 2 (

 / neu ) . The
